// SPDX-License-Identifier: MIT
pragma solidity 0.8.13;
//pragma abicoder v2;

//Inheritance - Parent-child relationships
import "./Ownable.sol";
import "./Ownerlist.sol";


/**
 * @title Multisig Wallet
 * @author Superior Blocks
 * @dev Multisig Wallet Smart Contract where multiple “signatures” or approvals 
 * are 
 * needed for an outgoing transfer to take place. As an example, I could create 
 * a multisig wallet with me and my 2 friends. Wallet requires at least 2 to sign any transfer before it is valid. Anyone 
 * can deposit funds into this wallet. But as soon as we want to spend funds, 
 * it requires 2/3 approvals
 */
contract Multisig_Wallet is Ownable, Ownerlist {

//State VARS
    uint approvals;


    mapping (address => uint) balance;

    //event logs
    event deposited (uint indexed amount, address indexed depositedTo);
    event transferedAmount(address indexed from, address indexed to, uint indexed amount);


    // Sets the required number of approvals.  Used the setter function example
    uint numApprovals;
        
    function setNumApprovals(uint _number) public {  //not view or pure because we are changing the state of "numApprovals"
        numApprovals = _number;
    }

    function getNumApprovals() public view returns(uint){
        return numApprovals;
    }

    // Make deposit
    function deposit() public payable returns (uint) { 
        balance[msg.sender] += msg.value; // just keeps track of internal balances & no longer needed because we don't need to track internal balances
        emit deposited (msg.value, msg.sender);      //log event
        return balance[msg.sender];
    }


    function getBalance() public view returns (uint){
        return balance[msg.sender];
    }

    //Make a withdrawal
    function withdraw(uint amount) public returns (uint){
        require(balance[msg.sender]>= amount,"ERROR 1_Insufficient balance to withdraw funds.");
        payable(msg.sender).transfer(amount);
        balance[msg.sender] -= amount;
        return balance[msg.sender];
    }

    //Approve a transfer only if you are an owner


    function transfer(address recipient, uint amount) onlyOwner public {
        require(balance[msg.sender]>= amount,"ERROR 1_Insufficient balance to transfer funds.");  //Check balance of msg.sender
        require(msg.sender != recipient,"ERROR 2_The sender cannot be the recipient.");
        require(isOwner(msg.sender), "ERROR 3_You are not an owner and not allowed to make transfer."); // fail hard


        uint previousSenderBalance = balance[msg.sender];
        _transfer (msg.sender, recipient, amount);  
        emit transferedAmount(msg.sender, recipient, amount);  //log event

        assert(balance[msg.sender] == previousSenderBalance - amount); 
    }

    function _transfer(address from, address to, uint amount) private {
        balance[from] -= amount;
        balance[to] += amount;
    }
    
}

